import "./nav.css";


function App() {
  return (
    <nav>  
      <li>Stevan</li>
      <li>Max</li>
      <li>Jonas</li>
      <li>Tobias</li>
      <li>Phillip</li>
  </nav>
  );
}



export default <nav>  
<li>Stevan</li>
<li>Max</li>
<li>Jonas</li>
<li>Tobias</li>
<li>Phillip</li>
</nav>;
